css:
atom-text-editor .line.github-editorCommentHighlight {
  background-color: #2f3d4c;
}
atom-text-editor .line.github-editorCommentHighlight.cursor-line {
  background-color: #445e75;
}
.gutter[gutter-name="github-comment-icon"] {
  width: 1.4em;
}
.github-editorCommentGutterIcon.decoration {
  width: 100%;
}
.github-editorCommentGutterIcon.react-atom-decoration {
  width: 100%;
  text-align: center;
  padding: 0 3.5px;
}
.github-editorCommentGutterIcon button {
  padding: 0;
  border: none;
  background: none;
  vertical-align: middle;
}
.github-EditorComment-omitted {
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #1e1e1e;
  border-radius: 2px;
  padding: 14px;
  margin: 7px 0;
}
.github-EditorComment-omitted p {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  margin: 3.5px;
}
.github-EditorComment-omitted button {
  margin-left: 14px;
}
